import React, { Component } from 'react';
import { ThemeContext } from '../contexts/ThemsContext';

class Navbar extends Component {

    static contextType = ThemeContext

    render() {
        console.log('context => ', this.context);

        return (
            <nav>
                <h1>Context App</h1>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Contact</li>
                </ul>
            </nav>
        );
    }
}

export default Navbar;
